import { useState, useEffect } from 'react';
import $ from 'jquery';
import Test from './test.js'

$(function() {
  console.log("loaded");
  $("li")[0].click();
  console.log($("li")[0].style.backgroundColor);
  $("li")[0].style.backgroundColor = "#272727";
});


const arr = [1, 2, 3 ,4, 5, 6, 7, 8, 9, 1, 2, 3 ,4, 5, 6, 7, 8, 9, 1, 2, 3 ,4, 5, 6, 7, 8, 9, 1];
const Subscription = () => {
  const [users, setUsers] = useState([]);
  const api = "AIzaSyB5_Kc5h-Z72FAt4LWm7veU-UWoS8LfUPc";
  const fetchUserData = () => { fetch("https://youtube.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&key=AIzaSyB5_Kc5h-Z72FAt4LWm7veU-UWoS8LfUPc&maxResults=30", {
      headers: {
          Authorization : api,
          Accept: "application/json"
      }
  }).then((response)=>{
      return response.json()
  }).then((val)=>{
        setUsers(val.items)
      });}

      useEffect(() => {
        fetchUserData()
      }, [])


  return(
      <>
      <div className="subscription_main">
        <div className="subscription_vids">
            
          {/* {users.length === 0 ? ( */}
          {true ? (
          arr.map(() => 
          <div className="vids">
            <div className="loader">
              <div className="wrapper">
                <div className="line-1"></div>
                <div className='ele'>
                  <div className='lines'>
                    <div className="line-2"></div>
                    <div className="line-3"></div>
                    <div className="line-4"></div>
                  </div>
                </div>
              </div>
            </div>
          </div>
          )
          
          ) : (

            users?.map(i => (
              <div className="vids">
                <div className="thumbnail" style={{backgroundImage: "url(' " + (i.snippet.thumbnails.maxres === undefined ? i.snippet.thumbnails.standard.url : i.snippet.thumbnails.maxres.url) + "')"}}>
                </div>
                <div className="chnl_text">
                  <div className="vid_desc">
                    <div className="main_desc">{users.length === 0 ? <>loading...</> : i.snippet.title}</div>
                    <div className="chnl_name">{users.length === 0 ? <>loading...</> : i.snippet.channelTitle}</div>
                    <div className="vid_stats">
                      <div className="vid_views">300k views <Test /></div>
                      <div className="partition">
                        <div className="partition_inside"></div>
                      </div>
                      <div className="vid_date">1 day ago</div>
                    </div>
                  </div>
                </div>
              </div>
            ))
          )}

        
        </div>
      </div>
      </>
    )

  };
  
  
  export default Subscription;
